 var checkrole = new GlideRecord('sys_user_has_role');
 checkrole.addQuery('user',getUser.sys_id);
 checkrole.addQuery('role' , 'a7b3b4498310d2502740f496feaad34d');
 checkrole.query();
 if(checkrole.hasNext())
 return true;
}

return false;"}}

